import React from "react";
// react plugin for creating charts
import ChartistGraph from "react-chartist";
// @material-ui/core
import { makeStyles } from "@material-ui/core/styles";
import Icon from "@material-ui/core/Icon";
// @material-ui/icons
import Store from "@material-ui/icons/Store";
import Warning from "@material-ui/icons/Warning";
import DateRange from "@material-ui/icons/DateRange";
import LocalOffer from "@material-ui/icons/LocalOffer";
import Update from "@material-ui/icons/Update";
import ArrowUpward from "@material-ui/icons/ArrowUpward";
import AccessTime from "@material-ui/icons/AccessTime";
import Accessibility from "@material-ui/icons/Accessibility";
import BugReport from "@material-ui/icons/BugReport";
import Code from "@material-ui/icons/Code";
import Cloud from "@material-ui/icons/Cloud";
// core components
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
import Table from "components/Table/Table.js";
import Tasks from "components/Tasks/Tasks.js";
import CustomTabs from "components/CustomTabs/CustomTabs.js";
import Danger from "components/Typography/Danger.js";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardIcon from "components/Card/CardIcon.js";
import CardBody from "components/Card/CardBody.js";
import CardFooter from "components/Card/CardFooter.js";

import { bugs, website, server } from "variables/general.js";

import {
  lightlevels1,
  humiditylevels1,
  waterlevels1,
} from "variables/charts.js";

import styles from "assets/jss/material-dashboard-react/views/dashboardStyle.js";

const useStyles = makeStyles(styles);

export default function Dashboard() {
  const classes = useStyles();
  return (
    <div>

      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="danger">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels1.data}
                type="Line"
                options={lightlevels1.options}
                listener={lightlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="primary">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels1.data}
                type="Line"
                options={humiditylevels1.options}
                responsiveOptions={humiditylevels1.responsiveOptions}
                listener={humiditylevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={waterlevels1.data}
                type="Line"
                options={waterlevels1.options}
                listener={waterlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Water Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="danger">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels1.data}
                type="Line"
                options={lightlevels1.options}
                listener={lightlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="primary">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels1.data}
                type="Line"
                options={humiditylevels1.options}
                responsiveOptions={humiditylevels1.responsiveOptions}
                listener={humiditylevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={waterlevels1.data}
                type="Line"
                options={waterlevels1.options}
                listener={waterlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Water Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="danger">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels1.data}
                type="Line"
                options={lightlevels1.options}
                listener={lightlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="primary">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels1.data}
                type="Line"
                options={humiditylevels1.options}
                responsiveOptions={humiditylevels1.responsiveOptions}
                listener={humiditylevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={waterlevels1.data}
                type="Line"
                options={waterlevels1.options}
                listener={waterlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Water Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


    </div>
  );
}
